## â—Breaking Changes

The `LambdaTestServer.CreateServer()` method has been marked as `[Obsolete]` and is no longer used to create the test server.

This is to prepare for the deprecation of `IWebHost` and `IWebHostBuilder.Build()` in ASP.NET Core 10.

Internally the Lambda test server now uses [`WebApplicationBuilder` and `WebApplication`](https://learn.microsoft.com/aspnet/core/fundamentals/minimal-apis/webapplication) instead of [`WebHostBuilder`](https://learn.microsoft.com/aspnet/core/fundamentals/host/web-host).

If your code is affected by this change, for example it was used to create a real HTTP server, then use the `ConfigureWebHost()` method to reconfigure the server instead.

For example:

```diff
// Remove override of CreateServer()
- protected override IServer CreateServer(IWebHostBuilder builder)
- {
-     var webHost = builder
-         .UseKestrel((p) => p.Listen(System.Net.IPAddress.Loopback, 0))
-         .Build();
-
-     return webHost.Services.GetRequiredService<IServer>();
- }

// Add override of ConfigureWebHost()
+ protected override void ConfigureWebHost(IWebHostBuilder builder)
+ {
+     base.ConfigureWebHost(builder);
+     builder.UseKestrel((p) => p.Listen(System.Net.IPAddress.Loopback, 0));
+ }
```

## What's Changed

* Add zizmor by @martincostello in https://github.com/martincostello/lambda-test-server/pull/1030
* Update workflow permissions by @martincostello in https://github.com/martincostello/lambda-test-server/pull/1031
* Replace `WebHost` usage with `WebApplication` by @martincostello in https://github.com/martincostello/lambda-test-server/pull/1032

**Full Changelog**: https://github.com/martincostello/lambda-test-server/compare/v0.10.0...v0.11.0

